import { Component } from '@angular/core';

@Component({
  selector: 'app-slider',
  templateUrl: './slider.component.html',
  styleUrls: ['./slider.component.css']
})
export class SliderComponent {

}
<section class="slider"  class="text-center" >
    <div class="layer">
        <img src="../../../../assets/images/layer.png" alt="">
    </div>

    <div class="container">
        <img src="../../../../assets/images/slider-img.png" alt="" class="w-100">
    </div>
</section>
